      text: "We very much believe that service is king, and taking care of people is what we are all about.  After leaving our office, you will know that we love what we do!  We see our clients as much more than income or profit margins, we get to know them.  Understanding where a person is coming from and how they think is the only way to properly provide the service that they need.  Just ask our clients why they do business with us -  I'm sure they'll tell you that we take care of them. \n"
