      spacing_above: none
      spacing_below: small
      text: "In 1998, Glenn had this crazy idea to leave his job and answer a newspaper add for a \"managerial position with a company poised for growth\".  Well, that company wasn't exactly what he expected, he found himself driving all over Ohio selling and servicing only Life and Health Insurance and the company he worked for was......, well we try not to talk about that.  After about 3 months of being told how to treat clients and clients asking Glenn if he sold auto and homeowners insurance also, he decided  he should (this would allow him to care for an entire families insurance needs). \n\nGlenn went on to spend eight years with American Family Insurance as a captive agent and Andi joined him in 2000.  Many awards were earned, including J.D. Powers Customer Service Award and The Huber Heights Chamber of Commerce Business Person of the Year award.  Glenn and Andi eventually figured out that they could do so much more for their clients by starting an independent insurance agency. \n\n After a couple of changes, Otto & Associates was born.  Finally, an independent insurance agency where Glenn and Andi could decide on the companies that they wanted to represent, how they would care for their clients and their families, and a greater selection of companies, allowed them to handle just about anyone who contacted them.  Welcome to our home. "
